import { SERVICES } from "../constants";

export default function ServicesSection() {
  return (
    <section className="ll-section ll-services-section">
      <div className="ll-container">
        <p className="ll-section-label">Capabilities</p>
        <h2 className="ll-section-title">What the Bot Handles</h2>
        <div className="ll-services-grid">
          {SERVICES.map((service) => (
            <div className="ll-service-card" key={service.title}>
              <div className="ll-service-icon">{service.icon}</div>
              <h3>{service.title}</h3>
              <p>{service.desc}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
